import React from "react";
import Header from "../../components/Header/Header";
import "./Main.css";

function Home() {
  return (
    <>
      <Header />
      <div className="back">
        당신의 새로운 시작을 위한 최적의 선택, 여러분의 행복을 위한 최적의
        선택을 제공합니다.
      </div>
    </>
  );
}

export default Home;
